import React from 'react';
import MyContext from './MyContext';
import Data from './data';
import { useState } from 'react';
function App() {
  const [cart, setCart] = useState(Data);


  return (
    <div className="App">
      <Header/>
      <Image/>
      <Summary/>
      <Menu setCart = {setCart} cart/>
    </div>
  );
}

export default App;
